import Carousel from 'react-bootstrap/Carousel';
import Card from 'react-bootstrap/Card';

import Image from './Images/image1';
// import image2 from './Images/image-2.jpg';

function Home() {
  return (
    <>
      <div className='container'>
        <div className='row'>
          <div className='card'>
            <img src={image1}></img>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
